import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import "./index.css";

const Signup = () => {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [res, setRes] = useState("");
  const navigate = useNavigate();

  const handleUsernameChange = (e) => {
    setUsername(e.target.value);
  };

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleConfirmPasswordChange = (e) => {
    setConfirmPassword(e.target.value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    if (
      username.length === 0 ||
      email.length === 0 ||
      password.length === 0 ||
      confirmPassword.length === 0
    ) {
      setRes("* Inputs should not be empty");
      return;
    }

    if (password !== confirmPassword) {
      setRes("Passwords do not match");
      return;
    }

    try {
      const response = await axios.post('http://localhost:8000/signup/', {
        username,
        email,
        password
      });
      setRes("User signed up successfully");
      setUsername("");
      setEmail("");
      setPassword("");
      setConfirmPassword("");
      navigate("/signin"); // Redirect to signin page after successful signup
    } catch (error) {
      if (error.response && error.response.data) {
        setRes(error.response.data.detail);
      } else {
        setRes("An error occurred. Please try again.");
      }
    }
  };

  return (
    <div className="bg">
      <div className="card-container">
        <img
          src="https://res.cloudinary.com/dlkovvlud/image/upload/v1699081090/Design_a_modern_and_captivating_logo_for_the_Gen-removebg-preview_2_vl2kfw.png"
          alt="website logo"
          className="website-logo"
        />
        <center>
          <h1 className="heading-signup">Signup</h1>
        </center>
        <form className="form" onSubmit={handleSubmit}>
          <div className="inner-form">
            <label className="label">USERNAME</label>
            <input
              type="text"
              value={username}
              onChange={handleUsernameChange}
              className="user-input"
              placeholder="Username"
            />
          </div>
          <div className="inner-form">
            <label className="label">EMAIL</label>
            <input
              type="email"
              value={email}
              onChange={handleEmailChange}
              className="user-input"
              placeholder="Email"
            />
          </div>
          <div className="inner-form">
            <label className="label">PASSWORD</label>
            <input
              type="password"
              value={password}
              onChange={handlePasswordChange}
              className="user-input"
              placeholder="Password"
            />
          </div>
          <div className="inner-form">
            <label className="label">CONFIRM PASSWORD</label>
            <input
              type="password"
              value={confirmPassword}
              onChange={handleConfirmPasswordChange}
              className="user-input"
              placeholder="Confirm Password"
            />
          </div>
          <p className="response-message">{res}</p>
          <button type="submit" className="submit-button">
            Signup
          </button>
          <div className="signin">
            <p className="already">Already have an account?</p>
            <Link to="/signin">
              <p className="login-button-signup-page">Signin</p>
            </Link>
          </div>
        </form>
      </div>
    </div>
  );
};

export default Signup;
